import React from "react";
import ReactDOM from "react-dom";
import "./grid.css";
import NavBar from "./components/NavBar";
import "./App.css";
import Greeting from "./components/Greeting";

/* CAC COMPONENT TRONG PJ NAY: 
 - NavBar 
 - Introduction 
 - PortItem 
 - ResumeItem
 - Comment
 - Services 
 - Contact 
 - Info 
*/

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="body">
        <div className="cover">
          <NavBar />
          <Greeting />
        </div>

        <div className="portfolio">
          <h1> Sản phẩm từng thực hiện </h1>
        </div>
      </div>
    );
  }
}
export default App;
